import mongoose,{Schema} from "mongoose";

const UserSchema = new Schema({
    name: {
        type: String,
        required: true
    },
    email: {
        type: String,
        required: true
    },
    pfp: {
        type: String,
        required: false,
        default: 'data:image/png;base64,'
    },
    role: {
        type: String,
        required: true
    },
    password: {
        type: String,
        required: true
    },
},{timestamps:true})

const User = mongoose.models.User || mongoose.model('User', UserSchema)

export default User